import React from 'react'
import Menu from './Menu'
import "./Header.css"

export default function Header(props) {
    Header.defaultProps = {
      name:'ICICI',
      branch:'Marathalli'
    }
    
  
  return (
    <div>
      
      <h1 className="s2" >{props.name},{props.branch}</h1>
      <Menu/>
      <hr />
    </div>
  )
}
